function App() {
  return (
    <Routes>
    <Route path="/" element={<Layout/>}>
      <Route
        index element={<İndexPage/>}
      />
      <Route path={"/login"} element={<div>login page</div>} />
      </Route>
    </Routes>
  );
}

export default App;
